import React, { useState } from "react";
import Select from "react-select";
import { Link } from "react-router-dom";
import "react-datepicker/dist/react-datepicker.css";
import { Modal, Tooltip, OverlayTrigger } from "react-bootstrap";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

// Images
import Pdf from "../../images/common/pdf.svg";
import Excel from "../../images/common/excel.svg";
import Error from "../../images/common/error.svg";
import Success from "../../images/common/success.svg";

const options = [
  { value: "10 Entries", label: "10 Entries" },
  { value: "25 Entries", label: "25 Entries" },
  { value: "50 Entries", label: "50 Entries" },
  { value: "100 Entries", label: "100 Entries" },
];

const TicketWindow = () => {
  const [resetFilters, setResetFilters] = useState(false);
  const [saveFilters, setSaveFilters] = useState(false);

  const [showFilters, setShowFilters] = useState(false);

  const [selectError, setSelectError] = useState(false);
  const changeSelectError = () => setSelectError(true);

  // Select Error
  const [clientName, setClientName] = useState(false);
  const changeClientName = () => setClientName(true);

  const [selectedOption, setSelectedOption] = useState(null);

  // Modals
  const [referenceNo, setReferenceNo] = useState(false);

  // Tooltip
  const renderTooltip = (props) => (
    <Tooltip id="button-tooltip" {...props}>
      Export to pdf
    </Tooltip>
  );

  const renderTooltipExcel = (props) => (
    <Tooltip id="button-tooltip" {...props}>
      Export to excel
    </Tooltip>
  );

    //   Date Calendar
    const [startDate, setStartDate] = useState(new Date());

  return (
    <div className="configLeft identificationContainer ticketCenterSection">
      {/* Breadcrumb */}
      <div className="d-flex justify-content-between align-items-center breadcrumbHeading">
        <h5 className="fontWeight-600 fileConfigHead colorBlack">
          Ticket Centre
        </h5>

        <div className="d-flex align-items-center">
          <Link to="/">
            <p className="fontSize12 colorPrimaryDefault">Dashboard</p>
          </Link>
          <span>
            <svg
              width="8"
              height="auto"
              viewBox="0 0 10 16"
              fill="none"
              xmlns="http://www.w3.org/2000/svg"
              className="mx-1"
            >
              <path
                d="M3 4L7 8L3 12"
                stroke="black"
                stroke-width="1.5"
                stroke-linecap="round"
                stroke-linejoin="round"
                className="breadcrumbIcon"
              />
            </svg>
          </span>
          <p className="fontSize12">Ticket Center</p>
        </div>
      </div>

      {/* Alert */}
      <div
        className="alert alert-warning alert-dismissible fade show"
        role="alert"
      >
        <strong>CAN:</strong> Feed delay from 0H:38M
        <button
          type="button"
          className="btn-close"
          data-bs-dismiss="alert"
          aria-label="Close"
        ></button>
      </div>

      {/* Search Criteria */}
      <div className="configLeftTop searchCriteriaBox">
        <div className="position-relative">
          <div className="lightBlueBox configTopBlueBox">
            <div className="d-flex justify-content-between align-items-center configLeftFilters">
              <h6 className="fontWeight-600 colorBlack">Search Criteria</h6>
              <button
                type="button"
                className="allFiltersBtn btn p-0 d-flex justify-content-center align-items-center"
                onClick={() => setShowFilters(true)}
              >
                <span className="icon-Filter-Icon"></span>
                <span className="ms-1 fontSize12-m colorPrimaryDefault">
                  All Filters
                </span>
              </button>
            </div>
            <div className="hrGreyLine"></div>
            <div className="configSelectBoxTop row">
              <div className="clientNameSelect col">
                <label htmlFor="clientName">Bank</label>
                <Select
                  defaultValue={selectedOption}
                  onChange={() => {
                    setClientName();
                    changeClientName();
                  }}
                  options={options}
                  id="clientName"
                  classNamePrefix="reactSelectBox"
                  placeholder="All"
                />
              </div>

              <div className="clientNameSelect col">
                <label htmlFor="clientName">LOC Type</label>
                <Select
                  defaultValue={selectedOption}
                  onChange={() => {
                    setClientName();
                    changeClientName();
                  }}
                  options={options}
                  id="clientName"
                  classNamePrefix="reactSelectBox"
                  placeholder="All"
                />
              </div>

              <div className="clientNameSelect col">
                <label htmlFor="clientName">Queue Type</label>
                <Select
                  defaultValue={selectedOption}
                  onChange={() => {
                    setClientName();
                    changeClientName();
                  }}
                  options={options}
                  id="clientName"
                  classNamePrefix="reactSelectBox"
                  placeholder="All"
                />
              </div>

              <div className="clientNameSelect col">
                <label htmlFor="clientName">Status</label>
                <Select
                  defaultValue={selectedOption}
                  onChange={() => {
                    setClientName();
                    changeClientName();
                  }}
                  options={options}
                  id="clientName"
                  classNamePrefix="reactSelectBox"
                  placeholder="All"
                />
              </div>

              <div className="clientNameSelect col">
                <label htmlFor="clientName">State</label>
                <Select
                  defaultValue={selectedOption}
                  onChange={() => {
                    setClientName();
                    changeClientName();
                  }}
                  options={options}
                  id="clientName"
                  classNamePrefix="reactSelectBox"
                  placeholder="All"
                />
              </div>

              <div className="clientNameSelect col">
                <label htmlFor="clientName">Site Type</label>
                <Select
                  defaultValue={selectedOption}
                  onChange={() => {
                    setClientName();
                    changeClientName();
                  }}
                  options={options}
                  id="clientName"
                  classNamePrefix="reactSelectBox"
                  placeholder="All"
                />
              </div>

              <div className="clientNameSelect col">
                <label htmlFor="clientName">Call Type</label>
                <Select
                  defaultValue={selectedOption}
                  onChange={() => {
                    setClientName();
                    changeClientName();
                  }}
                  options={options}
                  id="clientName"
                  classNamePrefix="reactSelectBox"
                  placeholder="All"
                />
              </div>

              <div className="clientNameSelect col">
                <label htmlFor="clientName">ATM Status</label>
                <Select
                  defaultValue={selectedOption}
                  onChange={() => {
                    setClientName();
                    changeClientName();
                  }}
                  options={options}
                  id="clientName"
                  classNamePrefix="reactSelectBox"
                  placeholder="All"
                />
              </div>

              <div className="clientNameSelect col">
                <label htmlFor="clientName">Make</label>
                <Select
                  defaultValue={selectedOption}
                  onChange={() => {
                    setClientName();
                    changeClientName();
                  }}
                  options={options}
                  id="clientName"
                  classNamePrefix="reactSelectBox"
                  placeholder="All"
                />
              </div>

              <div className="clientNameSelect col">
                <label htmlFor="clientName">Site Class</label>
                <Select
                  defaultValue={selectedOption}
                  onChange={() => {
                    setClientName();
                    changeClientName();
                  }}
                  options={options}
                  id="clientName"
                  classNamePrefix="reactSelectBox"
                  placeholder="All"
                />
              </div>
            </div>

            <div className="text-center btnsBtm">
              <button
                type="button"
                className="btnPrimaryOutline"
                onClick={() => setResetFilters(!resetFilters)}
              >
                Reset
              </button>
              <button
                type="button"
                className="btnPrimary ms-2"
                onClick={() => setSaveFilters(!saveFilters)}
              >
                Search
              </button>
            </div>
          </div>

          {showFilters ? (
            <div className="lightBlueBox configTopBlueBox absoluteFiltersBox">
              <div className="d-flex justify-content-between align-items-center configLeftFilters">
                <h6 className="fontWeight-600 colorBlack">Filters</h6>
                <button
                  type="button"
                  className="allFiltersBtn"
                  onClick={() => setShowFilters(false)}
                >
                  <span>
                    <svg
                      width="24"
                      height="24"
                      viewBox="0 0 24 24"
                      fill="none"
                      xmlns="http://www.w3.org/2000/svg"
                    >
                      <path
                        d="M6 6L18 18"
                        stroke="#004BBD"
                        stroke-width="1.8"
                        stroke-linecap="round"
                      />
                      <path
                        d="M18 6L6 18"
                        stroke="#004BBD"
                        stroke-width="1.8"
                        stroke-linecap="round"
                      />
                    </svg>
                  </span>
                </button>
              </div>
              <div className="hrGreyLine"></div>

              <div className="configSelectBoxTop row">
                <div className="clientNameSelect col">
                  <label htmlFor="clientName">Bank</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">LOC Type</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">Queue Type</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">Status</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">State</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">Site Type</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">Call Type</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">ATM Status</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">Make</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">Site Class</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">Category</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">Assigned To</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">CRA</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">Criticality</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">Sub Category</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                    <label htmlFor="channelType">To Date</label>
                    <DatePicker
                      selected={startDate}
                      onChange={(date) => setStartDate(date)}
                      className="unmatchedDate"
                    />
                  </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">Worklist</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">Ticket</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">CRA Visits</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">Sites</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="terminalCode">Enter Ticket ID</label>
                  <input
                    type="text"
                    name="terminalCode"
                    id="terminalCode"
                    placeholder="Ticket ID"
                    className="inputTextBox"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="terminalCode">Enter ATM ID</label>
                  <input
                    type="text"
                    name="terminalCode"
                    id="terminalCode"
                    placeholder="ATM ID"
                    className="inputTextBox"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="terminalCode">Enter Site ID</label>
                  <input
                    type="text"
                    name="terminalCode"
                    id="terminalCode"
                    placeholder="Site ID"
                    className="inputTextBox"
                  />
                </div>
              </div>

              <div className="text-center btnsBtm">
                <button
                  type="button"
                  className="btnPrimaryOutline"
                  onClick={() => setResetFilters(!resetFilters)}
                >
                  Reset
                </button>
                <button
                  type="button"
                  className="btnPrimary ms-2"
                  onClick={() => setSaveFilters(!saveFilters)}
                >
                  Search
                </button>
              </div>
            </div>
          ) : null}
        </div>

        {/* Reset Filters */}
        {resetFilters && (
          <Modal
            show={resetFilters}
            onHide={() => setResetFilters(!resetFilters)}
            centered
            className="defaultThemeModal saveFiltersModal errorFiltersModal"
          >
            <Modal.Header closeButton>
              <Modal.Title className="fontSize16-sm letterSpacing-2">
                Filters
              </Modal.Title>
            </Modal.Header>
            <Modal.Body className="text-center">
              <img src={Error} alt="Success" />
              <p className="letterSpacing-2 colorBlack">
                Filters could not be reset due to internal server error.
              </p>
            </Modal.Body>
          </Modal>
        )}

        {/* Save Filters */}
        {saveFilters && (
          <Modal
            show={saveFilters}
            onHide={() => setSaveFilters(!saveFilters)}
            centered
            className="defaultThemeModal saveFiltersModal"
          >
            <Modal.Header closeButton>
              <Modal.Title className="fontSize16-sm letterSpacing-2">
                Filters
              </Modal.Title>
            </Modal.Header>
            <Modal.Body className="text-center">
              <img src={Success} alt="Success" />
              <p className="letterSpacing-2 colorBlack">
                Filters Reset Successfully!
              </p>
            </Modal.Body>
          </Modal>
        )}
      </div>

      {/* Center Content */}
      <div className="accordion" id="unmatchedFilters">
        <div className="accordion-item">
          <div
            className="d-flex justify-content-between align-items-center configLeftFilters accordion-header"
            id="unmatchedFiltersHeading"
          >
            <h6 className="fontWeight-600 colorBlack">Summary</h6>
            <button
              className="allFiltersBtn btn p-0 d-flex justify-content-center align-items-center"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#unmatchedFiltersCollapse"
              aria-expanded="true"
              aria-controls="unmatchedFiltersCollapse"
            >
              <span className="icon-Hide"></span>
              <span className="ms-1 fontSize12-m colorPrimaryDefault">
                Show / Hide
              </span>
            </button>
          </div>
          <div
            id="unmatchedFiltersCollapse"
            className="accordion-collapse collapse show"
            aria-labelledby="unmatchedFiltersHeading"
            data-bs-parent="#unmatchedFilters"
          >
            <div className="accordion-body"></div>
          </div>
        </div>
      </div>

      {/* Bottom Content */}
      <div className="configLeftBottom">
